package com.hurix.api.externalAPIs;

import static io.restassured.RestAssured.given;
import io.restassured.response.Response;

import com.hurix.automation.utility.Log;

public class UpdateBookMetadata {
	
	public static Response updateBookMetadata(String categoryname,String clientBookId,String consumerKey, String consumerSecret)
	{		
		String uploadEpubBody =
				"{\"clientBookId\":\""+clientBookId+"\",\"thumbnail\":{\"base64\":"
						+ "\"\","
						+ "\"mimeType\":\"image/jpg\"},\"category\":\""+categoryname+"\"}";
		Response jsonResponse = null;
		try {
			Log.startTestCase("UpdateBookMetadata");
			Log.info("categoryname : "+categoryname);
			Log.info("clientBookId : "+clientBookId);

			jsonResponse = given()
					.auth()
					.oauth(consumerKey, consumerSecret, "", "")
					.header("Content-Type","application/json")
					.body(uploadEpubBody)
					.post("/DistributionServices/ext/api/updateBookMetadata");

			Log.info("UpdateBookMetadata Response: "+jsonResponse.then().extract().response().prettyPrint());
		} catch (Exception exp) 
		{
			Log.fail(exp.getMessage());
			Log.fail("fails due to"+ exp.getCause());
			//exp.printStackTrace();
		}
		Log.endTestCase("End");
		return jsonResponse;		
	}
}
